" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 552px\">",
"   <div class=\"ttl\">",
"    Operative approach for a preperitoneal inguinal hernia repair",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 532px; height: 380px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This figure depicts the cross-sectional anatomy of the right lower abdominal wall showing the preperitoneal space. This appraoch can be used for repair of a primary inguinal hernia or recurrent inguinal hernia previously repaired by an anterior mesh repair or a failed posterior approach.",
