"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Fusion of elbow ossification centers",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 408px; height: 401px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The secondary ossification centers fuse to create the mature bony elbow. The lateral epicondyle, trochlear, and capitellar centers fuse first; this unit then fuses with the distal humerus; the last fusion occurs at the medial epicondyle.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
