"  </div>",
"  <div id=\"topicText\">",
"   (For additional information",
"   <a class=\"drug drug_general\" href=\"mobipreview.htm?41/56/42888?source=see_link\">",
"    see \"Ranitidine: Drug information\"",
"   </a>",
"   and",
"   <a class=\"drug drug_patient\" href=\"mobipreview.htm?21/56/22405?source=see_link\">",
"    see \"Ranitidine: Patient drug information\"",
