"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Volume cycled versus pressure controlled ventilation",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\" class=\"container\">",
"     <tbody>",
"      <tr>",
"       <td class=\"container\">",
"        <table cellspacing=\"0\">",
"         <tbody>",
"          <tr>",
"           <td class=\"subtitle1_single\">",
"            Volume cycled",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"subtitle2_single\">",
"            Advantages",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"indent1\">",
"            Guaranteed tidal volume and VE",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"indent1\">",
"            Clinician familiarity",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"subtitle2_single\">",
"            Disadvantages",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"indent1\">",
"            Airway pressures not controlled",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"indent1\">",
"            Worse patient tolerance",
"           </td>",
"          </tr>",
"         </tbody>",
"        </table>",
"       </td>",
"       <td class=\"container\">",
"        <table cellspacing=\"0\">",
"         <tbody>",
"          <tr>",
"           <td class=\"subtitle1_single\">",
"            Pressure controlled",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"subtitle2_single\">",
"            Advantages",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"indent1\">",
"            Airway pressures controlled",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"indent1\">",
"            Better patient tolerance",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"subtitle2_single\">",
"            Disadvantages",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"indent1\">",
"            Less clinician familiarity",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"indent1\">",
"            VT and VE not guaranteed",
"           </td>",
"          </tr>",
"         </tbody>",
"        </table>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
